/**************************************************************/
/*                                                            */
/*  OptionTypeEnum                                            */
/*                                                            */
/**************************************************************/

static const OSEnumItem OptionTypeEnum_ENUMTAB[] = {
   { OSUTF8("Call"), 0, 4, 0 },
   { OSUTF8("Put"), 1, 3, 1 }
} ;
#define OptionTypeEnum_ENUMTABSIZE 2

const OSUTF8CHAR* OptionTypeEnum_ToString (OSINT32 value)
{
   OSINT32 idx = value;

   if (idx >= 0 && idx < OptionTypeEnum_ENUMTABSIZE) {
      return OptionTypeEnum_ENUMTAB
         [OptionTypeEnum_ENUMTAB[idx].transidx].name;
   }
   else
      return OSUTF8("_UNKNOWN_");
}

int OptionTypeEnum_ToEnum (OSCTXT* pctxt,
   const OSUTF8CHAR* value, OptionTypeEnum* pvalue)
{
   OSUINT32 valueLen = rtxUTF8LenBytes (value);
   OSINT32 idx = rtxLookupEnum (value, valueLen, OptionTypeEnum_ENUMTAB, 
      OptionTypeEnum_ENUMTABSIZE);

   if (idx >= 0) {
      *pvalue = (OptionTypeEnum)OptionTypeEnum_ENUMTAB[idx].value;
      return 0;
   }
   else {
      rtxErrAddStrParm (pctxt, (const char*)value);
      return LOG_RTERR (pctxt, RTERR_INVENUM);
   }
}

