/**************************************************************/
/*                                                            */
/*  ObligationCategoryEnum                                    */
/*                                                            */
/**************************************************************/

static const OSEnumItem ObligationCategoryEnum_ENUMTAB[] = {
   { OSUTF8("Bond"), 0, 4, 0 },
   { OSUTF8("BondOrLoan"), 1, 10, 1 },
   { OSUTF8("BorrowedMoney"), 2, 13, 2 },
   { OSUTF8("Loan"), 3, 4, 3 },
   { OSUTF8("Payment"), 4, 7, 4 },
   { OSUTF8("ReferenceObligationsOnly"), 5, 24, 5 }
} ;
#define ObligationCategoryEnum_ENUMTABSIZE 6

const OSUTF8CHAR* ObligationCategoryEnum_ToString (OSINT32 value)
{
   OSINT32 idx = value;

   if (idx >= 0 && idx < ObligationCategoryEnum_ENUMTABSIZE) {
      return ObligationCategoryEnum_ENUMTAB
         [ObligationCategoryEnum_ENUMTAB[idx].transidx].name;
   }
   else
      return OSUTF8("_UNKNOWN_");
}

int ObligationCategoryEnum_ToEnum (OSCTXT* pctxt,
   const OSUTF8CHAR* value, ObligationCategoryEnum* pvalue)
{
   OSUINT32 valueLen = rtxUTF8LenBytes (value);
   OSINT32 idx = rtxLookupEnum (value, valueLen, 
      ObligationCategoryEnum_ENUMTAB, ObligationCategoryEnum_ENUMTABSIZE);

   if (idx >= 0) {
      *pvalue = (ObligationCategoryEnum)
         ObligationCategoryEnum_ENUMTAB[idx].value;
      return 0;
   }
   else {
      rtxErrAddStrParm (pctxt, (const char*)value);
      return LOG_RTERR (pctxt, RTERR_INVENUM);
   }
}

